import React from "react"
import { Text, View } from "react-native"
export const DrawerContent = (props) => {
    return (
        <View style={{
            flex : 1,
            alignItems : 'center',
            justifyContent : 'center'
        }}>
            <Text>This is a test</Text>
        </View>
    )
}
